★ロードスバレンチノの半袖ポロシャツ！<br>
<br>
●吸湿性に優れた爽やかさ。吸汗速乾仕様！<br>
●軽量、薄手で屋内外で活躍！<br>
●脇部分にデオドラントテープを使用！<br>
●ベーシックなデザインのポロシャツなので、スポーツ時にも普段着にも幅広くお使いいただけます！<br>
●前立てから覗くラインとボタンダウンデザインがカジュアルさを演出。<br>
●左胸にはポケットつき。<br>
<br>
