●スポーツ時に単にきつく締めるのではなく、それぞれの位置に適したレベルの着圧を与えます。また、筋肉の振動や怪我のリスクの軽減をサポートし、身体の負担をリカバリーするため、連戦やトレーニングを効果的に行うことが可能です。ランを中心としたエクササイズ時に更なる機能性を付加。各部位の動きを考慮したパターンと素材の配置により快適性と安全性を実現。ナイトランでも安全な低い位置でのリフレター。気化熱クーリング。肌あたりの軽減と縫製の改良。<br>●素材：ナイロン７６％、ポリウレタン２４％<br>●カラー：ブラック×ゴールド ( ＢＫＢＫ )<br>●サイズ：ＸＳ、Ｓ、Ｍ、Ｌ、ＸＬ<br>●機能：ダイナミックコンプレッション（動的段階的着圧）、メモリーＭＸ<br><br>●<br>商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。<br><br><br>
